INSERT INTO `s_blog` (`id`, `name`, `url`, `meta_title`, `meta_keywords`, `meta_description`, `annotation`, `text`, `visible`, `date`, `image`) VALUES
(1, 'LIV — стильные эксклюзивные велосипеды для девушек', 'liv--stilnye-eksklyuzivnye-velosipedy-dlya-devushek', 'LIV — стильные эксклюзивные велосипеды для девушек', 'LIV — стильные эксклюзивные велосипеды для девушек', '', '', '<div class=\"text\"><p>Порой даже самые лучшие велозамки не могут обеспечить защиту велосипеда от кражи. Чилийские инженеры говорят, что нашли эффективный способ борьбы с велосипедными ворами. Они создали первый в мире &laquo;неугоняемый&raquo; велосипед.</p><p>Внешне Yerka выглядит как обычный велосипед, но имеет особую конструкцию рамы, которая позволяет разбирать нижнюю трубу на две части, чтобы пристегнуть велосипед к столбу или дереву. По словам авторов проекта, превращение рамы в замок занимает всего 10 секунд.</p><p>На прошлой неделе молодые ребята сообщили о размещении первого заказа на производство 300 Yerka. Большую часть средств на реализацию проекта обеспечило краудфандинговое сообщество Indiegogo.</p><p>Первые 100 велосипедов предлагаются по цене 400 долларов. Все последующие будут стоить на 100 долларов дороже.</p><p><img src=\"https://placeimg.com/800/400/any/2\" alt=\"\" /></p><p>Как сообщает Fox News, к созданию &laquo;неугоняемого&raquo; велосипеда ребят подтолкнула кража двух велосипедов у одного из них.</p><p>Кроме того, крепления колес Yerka оборудованы противоугонными гайками, которые откручиваются только специальным ключом. Сейчас инженеры работают над мобильным приложением, которое позволяет открывать замок велосипеда с помощью смартфона.</p></div>', 1, '2011-10-21 22:00:00', 'news-main-catalog-1.png'),
(2, 'Первый взгляд на коллекцию велосипедов LTD 2018 года', 'pervyj-vzglyad-na-kollektsiyu-velosipedov-ltd-2018-goda', 'Первый взгляд на коллекцию велосипедов LTD 2018 года', 'Первый взгляд на коллекцию велосипедов LTD 2018 года', 'Порой даже самые лучшие велозамки не могут обеспечить защиту велосипеда от кражи. Чилийские инженеры говорят, что нашли эффективный способ борьбы с велосипедными ворами. Они создали первый в мире &laquo;неугоняемый&raquo; велосипед.', '<p>Порой даже самые лучшие велозамки не могут обеспечить защиту велосипеда от кражи. Чилийские инженеры говорят, что нашли эффективный способ борьбы с велосипедными ворами. Они создали первый в мире &laquo;неугоняемый&raquo; велосипед.</p>', '<div class=\"text\"><p>Порой даже самые лучшие велозамки не могут обеспечить защиту велосипеда от кражи. Чилийские инженеры говорят, что нашли эффективный способ борьбы с велосипедными ворами. Они создали первый в мире &laquo;неугоняемый&raquo; велосипед.</p><p>Внешне Yerka выглядит как обычный велосипед, но имеет особую конструкцию рамы, которая позволяет разбирать нижнюю трубу на две части, чтобы пристегнуть велосипед к столбу или дереву. По словам авторов проекта, превращение рамы в замок занимает всего 10 секунд.</p><p></p><figure><img src=\"https://placeimg.com/800/400/any/1\" alt=\"\" /><figcaption>Подпись к фото</figcaption></figure><p></p><p>На прошлой неделе молодые ребята сообщили о размещении первого заказа на производство 300 Yerka. Большую часть средств на реализацию проекта обеспечило краудфандинговое сообщество Indiegogo.</p><p>Первые 100 велосипедов предлагаются по цене 400 долларов. Все последующие будут стоить на 100 долларов дороже.</p><p><img src=\"https://placeimg.com/800/400/any/2\" alt=\"\" /></p><p>Как сообщает Fox News, к созданию &laquo;неугоняемого&raquo; велосипеда ребят подтолкнула кража двух велосипедов у одного из них.</p><p>Кроме того, крепления колес Yerka оборудованы противоугонными гайками, которые откручиваются только специальным ключом. Сейчас инженеры работают над мобильным приложением, которое позволяет открывать замок велосипеда с помощью смартфона.</p></div>', 1, '2019-05-12 22:00:00', 'news-2.jpeg'),
(3, 'COBI сделает из велосипеда умное устройство', 'cobi-sdelaet-iz-velosipeda-umnoe-ustrojstvo', 'COBI сделает из велосипеда умное устройство', 'COBI сделает из велосипеда умное устройство', 'Порой даже самые лучшие велозамки не могут обеспечить защиту велосипеда от кражи. Чилийские инженеры говорят, что нашли эффективный способ борьбы с велосипедными ворами. Они создали первый в мире &laquo;неугоняемый&raquo; велосипед.', '<p>Порой даже самые лучшие велозамки не могут обеспечить защиту велосипеда от кражи. Чилийские инженеры говорят, что нашли эффективный способ борьбы с велосипедными ворами. Они создали первый в мире &laquo;неугоняемый&raquo; велосипед.</p>', '<div class=\"text\"><p>Порой даже самые лучшие велозамки не могут обеспечить защиту велосипеда от кражи. Чилийские инженеры говорят, что нашли эффективный способ борьбы с велосипедными ворами. Они создали первый в мире &laquo;неугоняемый&raquo; велосипед.</p><p>Внешне Yerka выглядит как обычный велосипед, но имеет особую конструкцию рамы, которая позволяет разбирать нижнюю трубу на две части, чтобы пристегнуть велосипед к столбу или дереву. По словам авторов проекта, превращение рамы в замок занимает всего 10 секунд.</p><p></p><figure><img src=\"https://placeimg.com/800/400/any/1\" alt=\"\" /><figcaption>Подпись к фото</figcaption></figure><p></p><p>На прошлой неделе молодые ребята сообщили о размещении первого заказа на производство 300 Yerka. Большую часть средств на реализацию проекта обеспечило краудфандинговое сообщество Indiegogo.</p><p>Первые 100 велосипедов предлагаются по цене 400 долларов. Все последующие будут стоить на 100 долларов дороже.</p><p><img src=\"https://placeimg.com/800/400/any/2\" alt=\"\" /></p><p>Как сообщает Fox News, к созданию &laquo;неугоняемого&raquo; велосипеда ребят подтолкнула кража двух велосипедов у одного из них.</p><p>Кроме того, крепления колес Yerka оборудованы противоугонными гайками, которые откручиваются только специальным ключом. Сейчас инженеры работают над мобил