(185, '2018-04-26 19:19:35', '91.76.185.35', 'metroyccw', 'gwenn_taliulu26@rambler.ru', 'Здравствуйте! \r\n \r\nОказываем помощь в оформлении физическим лицам и сотрудникам организаций карт клиента метро  в сеть немецких магазинов  МЕТРО КЕШ ЭНД КЭРРИ.  \r\n \r\nhttp://купить-карту-метро.рф \r\n \r\nОфициально по юридическому договору оформим на физических лиц и сотрудников учереждений пропуска в метrо в сеть торговых центров \"Метро Кэш энд Кэрри\": карточка метро с вашим фото (делается при вас в самом магазине METRO Cash & Carry) , с личным номером, кодом, магнитной полосой, названием организации, от которой вы будете нами зарегистрированы. \r\n \r\nВы можете проводить с собой двух человек. \r\n \r\nКарты клиента metro оформляются: на граждан России и иностранцев. \r\n \r\nОформление делается без предоплаты, то есть вначале мы регистрируем и оформляем вас, вы получаете карточки metro, потом оплачиваете. \r\n \r\nОплата производится в течение 1-го рабочего дня после оформления, немецкие магазины  МETRO CASH and CARRY работают 24 часа. \r\n \r\nДля оказания этой услуги мы находим фирмы, у которых есть свободные места в этих немецких гипермаркетах, и заключаем с ними соответствующие юридические договора, по которым предприятия обязуются предоставить вам право пользоваться их местами в этих немецких тц. \r\n \r\nОформление и регистрация производятся во всех супермаркетах Metro CASH&CARRY. \r\n \r\nПолучив карты клиента metro в одном из магазинов Metro CASH and CARRY вы можете ею пользоваться в любых других магазинах этой сети супермаркетов \"Метро Кэш энд Керри\" в Российской Федерации и за границей. \r\n \r\nПОЖАЛУЙСТА, НЕ ОТВЕЧАЙТЕ НА ЭТО ПИСЬМО, ДЛЯ ЗАКАЗА КАРТ-КЛИЕНТА ИСПОЛЬЗУЙТЕ контакт-форму с сайта http://купить-карту-метро.рф \r\n \r\nВАШ ЗАКАЗ БУДЕТ ПРИНЯТ И ОБРАБОТАН В ТЕЧЕНИЕ РАБОЧЕГО ДНЯ. \r\n \r\nИСПОЛНЕНИЕ ЗАКАЗА 2-3 РАБОЧИХ ДНЯ. \r\n \r\nПОЛУЧЕНИЕ В 50 ГОРОДАХ И РЕГИОНАХ РОССИИ: \r\nAdugeja, Arkhangelsk, Astrakhan, Barnayl, Брянск, Белгород, Vladimir, Volgograd, Volzhsky, Вологда, Voronej, Voronezh region, Екатеринбург, Иваново, Izhevsk, Irkutsk, Казань, Калининград, Kalyga, Кемерово, Kirov, Kopeysk, Краснодар, Krasnojarsk, Kursk, Lipeck, Магнитогорск, Moskva, In city the Moscow region, Naberejnue Chelnu, Нижний Новгород, Nizhny Tagil, Novokyzneck, Novorossiysk, Новосибирск, Omsk, Orenburg, Орёл, Penza, Perm, Pjatigorsk, Ростов-на-Дону, Ryazan, Самара, Санкт-Петербург, Saratov, Serpyxov, Smolensk, Stavropol, Sterlitamak, Syrgyt, Tver, Toljatti, Томск, Тула, Тюмень, Yljanovsk, Ufa, Чебоксары, Cheljabinsk, Jaroslavl, Севастополь, Симферополь.', 0),
