(187, '2018-05-02 01:22:44', '131.153.40.188', 'Вы нужны нам...', 'forestyear@yandex.ru', 'Вы нам нужны! \r\n \r\nБлаготворительный фонд «Зеленая планета» \r\n \r\nУважаемые соотечественники Вы получили письмо с просьбой о помощи, в нелегком труде. \r\n \r\nВ текущее время в условиях рыночной экономики, люди много времени уделяют работе, которая нацелена на создание и потребление вещей не связанных с природой. \r\n \r\nМы родились на нашей Земле, Она дала нам свой Кров и Дом. \r\n \r\nДавайте вместе постараемся вернуть хоть небольшой долг нашей Матушке. \r\n \r\nПросим Вас пожертвовать небольшую сумму в Благотворительный Фонд. \r\n \r\nНаправленные средства необходимы для развития и внедрения массовых посадок ягодных кустарников, расширения лесных территории. Решения проблемы «заточения» зоопарками. \r\n \r\nМы не одни на нашей планете. \r\n \r\nДаже небольшая сумма - 10 рублей внесут огромный вклад в развитие. \r\n \r\nНе оставляйте без внимания, не пожалейте 2 минут Вашего времени. Помогите Нам! \r\n \r\nЗапишите на бумажке номер карты, поделитесь информацией с коллегой! Не оставляйте без внимания. \r\n \r\nНомер карты Сбербанка: 4276 8680 1480 3364 \r\n \r\nМы будем Благодарны любым средствам! \r\n \r\nПомогите Нам! \r\nforestyear@rambler.ru', 0),
