(289, '2018-07-07 21:52:24', '158.255.132.101', 'metronhun', 'jaida_sugerak48@rambler.ru', 'Здравствуйте! \r\n \r\nОказываем помощь в получении физическим лицам и сотрудникам учереждений карт клиента metro в сеть гипермаркетов МETRO CASH&CARRY.  \r\n \r\nкупить-карту-метро.рф \r\n \r\nЗаконно по договору сделаем на физических лиц и сотрудников фирм карты metro в сеть магазинов МЕТРО КЕШ ЭНД КЭРРИ: карточка метро  обязательно с вашей фотографией (делается в самом магазине в вашем присутствии), с личным номером, кодом, со специальной магнитной полосой, названием фирмы, от которой вы будете нами зарегистрированы и оформлены. \r\n \r\nВы можете проводить с собой двух человек. \r\n \r\nКарточки метро оформляются: на граждан России и иностранных граждан. \r\n \r\nОформление производится без предоплаты, то есть вначале мы регистрируем и оформляем вас, вы получаете карты метро, потом оплачиваете. \r\n \r\nОплата производится в течение 1-го рабочего дня после оформления, немецкие тц МETRO Cash and Cаrry работают 24 часа. \r\n \r\nДля оказания этой услуги мы находим фирмы, у которых есть свободные места в этих немецких гипермаркетах, и заключаем с ними соответствующие юридические договора, по которым учреждения обязуются предоставить вам право пользоваться их местами в этих немецких тц. \r\n \r\nОформление производятся во всех магазинах МETRO CASH and CARRY. \r\n \r\nПолучив карты клиента метро  в одном из немецких тц МЕТРО вы можете ею пользоваться в любых других магазинах этой сети гипермаркетов МETRO в Российской Федерации и за границей. \r\n \r\nПОЖАЛУЙСТА, НЕ ОТВЕЧАЙТЕ НА ЭТО ПИСЬМО, ДЛЯ ЗАКАЗА КАРТ-КЛИЕНТА ИСПОЛЬЗУЙТЕ контакт-форму с сайта купить-карту-метро.рф \r\n \r\nВАШ ЗАКАЗ БУДЕТ ПРИНЯТ И ОБРАБОТАН В ТЕЧЕНИЕ РАБОЧЕГО ДНЯ. \r\n \r\nИСПОЛНЕНИЕ ЗАКАЗА 2-3 РАБОЧИХ ДНЯ. \r\n \r\nПОЛУЧЕНИЕ В 50 ГОРОДАХ И РЕГИОНАХ РОССИИ: \r\nAdygea, Arxangelsk, Astraxan, Barnaul, Brjansk, Белгород, Владимир, Volgograd, Voljskii, Вологда, Voronezh, Voronejskaja oblast, Ekaterinburg, Иван