(451, '2018-11-29 01:46:18', '91.79.31.229', 'metrojwop', 'charisse_gammage82@rambler.ru', 'Здравствуйте! \r\n \r\nСделаем на частных лиц и сотрудников фирм пропуска в метро в сеть немецких супермаркетов МETRO CASH & CARRY.  \r\n \r\nhttp://купить-карту-метро.рф \r\n \r\nЗаконно по договору оформим на частных лиц и сотрудников предприятий пропуска в метро в сеть немецких супермаркетов МЕТРО КЕШ ЭНД КЕРРИ: карточка метро только с вашим фото (делается при вас в самом магазине), с личным номером, кодом, со специальной магнитной полосой, названием фирмы, от которой вы будете нами зарегистрированы и оформлены. \r\n \r\nВы можете проводить с собой двух человек. \r\n \r\nКарты клиента метро  оформляются: на граждан РФ и иностранных граждан. \r\n \r\nОформление производится без предоплаты, то есть вначале мы регистрируем и оформляем вас, вы получаете карты клиента metro, потом оплачиваете. \r\n \r\nОплата производится в течение одного рабочего дня после оформления, супермаркеты МETRO CASH&CARRY работают круглосуточно. \r\n \r\nДля оказания этой услуги мы находим фирмы, у которых есть свободные места в этих гипермаркетах, и заключаем с ними соответствующие договора, по которым учреждения обязуются предоставить вам право пользоваться их местами в этих немецких тц. \r\n \r\nОформление и регистрация производятся во всех немецких гипермаркетах Metro. \r\n \r\nПолучив карты клиента metro в одном из супермаркетов МETRO вы можете ею пользоваться в любых других магазинах этой сети гипермаркетов МЕТРО в РФ и за границей. \r\n \r\nПОЖАЛУЙСТА, НЕ ОТВЕЧАЙТЕ НА ЭТО ПИСЬМО, ДЛЯ ЗАКАЗА КАРТ-КЛИЕНТА ИСПОЛЬЗУЙТЕ контакт-форму с сайта купить-карту-метро.рф \r\n \r\nВАШ ЗАКАЗ БУДЕТ ПРИНЯТ И ОБРАБОТАН В ТЕЧЕНИЕ РАБОЧЕГО ДНЯ. \r\n \r\nИСПОЛНЕНИЕ ЗАКАЗА 2-3 РАБОЧИХ ДНЯ. \r\n \r\nПОЛУЧЕНИЕ В 50 ГОРОДАХ И РЕГИОНАХ РОССИИ: \r\nAdugeja, Arxangelsk, Astraxan, Барнаул, Bryansk, Belgorod, Владимир, Волгоград, Volzhsky, Vologda, Voronezh, Воронежская область, Ekaterinburg, Ivanovo, Ижевск, Irkutsk, Казан