(1, 'Receipt', 'Квитанция', '<p>Вы можете распечатать квитанцию и оплатить её в любом отделении банка.</p>', 2, 'a:10:{s:9:\"recipient\";s:65:\"ООО \"Великолепный интернет-магазин\"\";s:3:\"inn\";s:5:\"12345\";s:7:\"account\";s:6:\"223456\";s:4:\"bank\";s:18:\"Альфабанк\";s:3:\"bik\";s:6:\"556677\";s:21:\"correspondent_account\";s:11:\"77777755555\";s:8:\"banknote\";s:7:\"руб.\";s:5:\"pense\";s:7:\"коп.\";s:5:\"purse\";s:2:\"ru\";s:10:\"secret_key\";s:0:\"\";}', 1, 6),
(2, 'Webmoney', 'Webmoney wmz', '<p><span></span></p><div><p>Оплата через платежную систему&nbsp;<a href=\"http://www.webmoney.ru\">WebMoney</a>. У вас должен быть счет в этой системе для того, чтобы произвести оплату. Сразу после оформления заказа вы будете перенаправлены на специальную страницу системы WebMoney, где сможете произвести платеж в титульных знаках WMZ.</p></div><p>&nbsp;</p>', 3, 'a:10:{s:9:\"recipient\";s:0:\"\";s:3:\"inn\";s:0:\"\";s:7:\"account\";s:0:\"\";s:4:\"bank\";s:0:\"\";s:3:\"bik\";s:0:\"\";s:21:\"correspondent_account\";s:0:\"\";s:8:\"banknote\";s:7:\"руб.\";s:5:\"pense\";s:0:\"\";s:5:\"purse\";s:13:\"Z111111111111\";s:10:\"secret_key\";s:13:\"testsecretkey\";}', 1, 5),
(3, 'Robokassa', 'Робокасса', '<p><span>ROBOKASSA &ndash; сервис для организации приема платежей на сайте, интернет магазине и социальных сетях. Прием платежей осуществляется при минимальных комиссиях.</span></p>', 3, 'a:4:{s:5:\"login\";s:0:\"\";s:9:\"password1\";s:0:\"\";s:9:\"password2\";s:0:\"\";s:8:\"language\";s:2:\"ru\";}', 1, 7),
(4, 'Paypal', 'PayPal', '<p>Совершайте покупки безопасно, без раскрытия информации о своей кредитной карте. PayPal защитит вас, если возникнут проблемы с покупкой.</p>', 1, 'a:2:{s:8:\"business\";s:0:\"\";s:4:\"mode\";s:7:\"sandbox\";}', 1, 8),
(5, 'Interkassa', 'Оплата через Интеркассу', '<p><span>Это удобный в использовании сервис, подключение к которому позволит Интернет-магазинам, веб-сайтам и прочим торговым площадкам принимать все возможные формы оплаты в максимально короткие сроки.</span></p>', 2, 'a:2:{s:18:\"interkassa_shop_id\";s:3:\"123\";s:21:\"interkassa_secret_key\";s:3:\"123\";}', 1, 9),
(6, 'Liqpay', 'Оплата картой через Liqpay.com', '<p><span>Благодаря своей открытости и универсальности LiqPAY стремительно интегрируется со многими платежными системами и платформами и становится стандартом платежных операций.</span></p>', 2, 'a:5:{s:9:\"liqpay_id\";s:3:\"123\";s:11:\"liqpay_sign\";s:3:\"123\";s:12:\"pay_way_card\";s:1:\"1\";s:14:\"pay_way_liqpay\";s:1:\"1\";s:15:\"pay_way_delayed\";s:1:\"1\";}', 1, 10),
(7, 'Pay2Pay', 'Оплата через Pay2Pay', '<p>Универсальный платежный сервис Pay2Pay призван облегчить и максимально упростить процесс приема электронных платежей на Вашем сайте. Мы открыты для всего нового и сверхсовременного.</p>', 2, 'a:5:{s:18:\"pay2pay_merchantid\";s:3:\"123\";s:14:\"pay2pay_secret\";s:3:\"123\";s:14:\"pay2pay_hidden\";s:3:\"123\";s:15:\"pay2pay_paymode\";s:3:\"123\";s:16:\"pay2pay_testmode\";s:1:\"1\";}', 1, 11),
(8, 'Qiwi', 'Оплатить через QIWI', '<p><span>QIWI &mdash; удобный сервис для оплаты повседневных услуг.</span></p>', 2, 'a:2:{s:10:\"qiwi_login\";s:3:\"123\";s:13:\"qiwi_password\";s:3:\"123\";}', 1, 12),
(9, 'YandexMoney', 'Яндекс.Деньги', '<p><span>Яндекс</span><span>.</span><span>Деньги</span><span>&nbsp;&mdash; доступный и безопасный способ платить за товары и услуги через интернет.</span></p>', 2, 'a:5:{s:13:\"yandex_shopid\";s:2:\"90\";s:11:\"yandex_scid\";s:5:\"50938\";s:15:\"yandex_password\";s:20:\"rVOs4ZDVkfkqgpRlyXqn\";s:18:\"yandex_paymenttype\";s:2:\"PC\";s:15:\"yandex_testmode\";s:1:\"1\";}', 1, 1),
(10, 'YandexMoney', 'Банковская карта', '<p><span>Оплата банковской картой Visa или MasterCard через систему Яндекс.Деньги.</span></p>', 2, 'a:5:{s:13:\"yandex_shopid\";s:2:\"90\";s:11:\"yandex_scid\";s:5:\"50938\";s:15:\"yandex_password\";s:20:\"rVOs4ZDVkfkqgpRlyXqn\";s:18:\"yandex_paymenttype\";s:2:\"AC\";s:15:\"yandex_testmode\";s:1:\"1\";}', 1, 2),
(11, 'YandexMoney', 'Через терминал', '<p>Оплатита наличными через многочисленные терминалы в любом городе России. Можно заплатить и с банковской карты через многие банкоматы. Для этого найдите в меню терминала или банкомата логотип Яндекса и укажите код платежа.</p>', 2, 'a:5:{s:13:\"yandex_shopid\";s:2:\"90\";s:11:\"yandex_scid\";s:5:\"50938\";s:15:\"yandex_password\";s:20:\"rVOs4ZDVkfkqgpRlyXqn\";s:18:\"yandex_paymenttype\";s:2:\"GP\";s:15:\"yandex_testmode\";s:1:\"1\";}', 1, 3),
(12, 'YandexMoney', 'Со счета мобильного телефона', '<p><span>Оплата со&nbsp;счета мобильного телефона&nbsp;через систему Яндекс.Деньги</span></p>', 2, 'a:5:{s:13:\"yandex_shopid\";s:2:\"90\";s:11:\"yandex_scid\";s:5:\"50938\";s:15:\"yandex_password\";s:20:\"rVOs4ZDVkfkqgpRlyXqn\";s:18:\"yandex_paymenttype\";s:2:\"MC\";s:15:\"yandex_testmode\";s:1:\"1\";}', 1, 4);
INSERT INTO `s_products` (`id`, `url`, `brand_id`, `name`, `annotation`, `body`, `visible`, `position`, `meta_title`, `meta_keywords`, `meta_description`, `created`, `featured`, `new`, `rating`, `votes`, `external_id`) VALUES
(2, 'stul-sundays-shanghai-', 150, 'Стул Sundays Shanghai ', '<p>Комплект мебели состоит из двухместного дивана, 2-х кресел и журнального столика.&nbsp;</p>', '<p><span>Премиальный комплект садовой мебели Sundays Shanghai KF-19013 выполнен из профильного алюминия размером 40х40мм и толщиной 2мм. Комплект мебели состоит из двухместного дивана, 2-х кресел и журнального столика. Столешница и подлокотники изготовлены из дерева со специальной пропиткой. Комплект декорирован синтетическим жгутом. Мягкие подушки имеют съемный чехол, который можно легко постирать. Мебель полностью погодоустойчива - каркас не подвержен коррозии, дерево не выгорает на солнце. Благодаря небольшому весу мебель легко перемещать или транспортировать.</span></p>', 1, 2, 'Стул Sundays Shanghai ', 'Стул Sundays Shanghai , Sundays, Садовые стулья и кресла', 'Комплект мебели состоит из двухместного дивана, 2-х кресел и журнального столика.', '2019-05-29 06:58:34', 1, 1, 0.00, 0, ''),
(10, 'stul-sundays-shanghai-2', 150, 'Комплект садовой мебели Sundays Shanghai KF-19013', '<p>Комплект мебели состоит из двухместного дивана, 2-х кресел и журнального столика.&nbsp;</p>', '<p><span>Премиальный комплект садовой мебели Sundays Shanghai KF-19013 выполнен из профильного алюминия размером 40х40мм и толщиной 2мм. Комплект мебели состоит из двухместного дивана, 2-х кресел и журнального столика. Столешница и подлокотники изготовлены из дерева со специальной пропиткой. Комплект декорирован синтетическим жгутом. Мягкие подушки имеют съемный чехол, который можно легко постирать. Мебель полностью погодоустойчива - каркас не подвержен коррозии, дерево не выгорает на солнце. Благодаря небольшому весу мебель легко перемещать или транспортировать.</span></p>', 1, 3, 'Комплект садовой мебели Sundays Shanghai KF-19013', 'Комплект садовой мебели Sundays Shanghai KF-19013, Sundays, Садовые стулья и кресла', 'Комплект мебели состоит из двухместного дивана, 2-х кресел и журнального столика.', '2019-05-29 08:23:40', 1, 1, 0.00, 0, ''),
(3, 'divan-sadovyj-garden4you', 151, 'Диван садовый Garden4you', '<p>Каркас изготовлен&nbsp;&nbsp;из легкого и высокопрочного алюминия с плетением из пластика темно-коричневого цвета.</p>', '<p><span>Garden4you mini MUSE 1188 &ndash; это привлекательный раскладной диван с навесом. Каркас изготовлен&nbsp;&nbsp;из легкого и высокопрочного алюминия с плетением из пластика темно-коричневого цвета. В производстве садовой мебели плетение из пластика очень популярно, так как он является прочным, влагоустойчивым и неприхотливым в уходе. Он идеально подходит для длительного использования на улице, а наличие навеса защитит вас от прямых солнечных лучей, при ненадобности он легко складывается. Диван Garden4you mini MUSE 1188 украсит террасу или сад дачного участка, загородного дома.</span></p>', 1, 6, 'Диван садовый Garden4you', 'Диван садовый Garden4you, Rugen, Садовые диваны', 'Каркас изготовлен из легкого и высокопрочного алюминия с плетением из пластика темно-коричневого цвета.', '2019-05-29 07:09:08', 1, 1, 0.00, 0, ''),
(9, 'divan-sadovyj-garden4you_2', 151, 'Диван садовый Garden4you mini MUSE 1188', '<p>Каркас изготовлен&nbsp;&nbsp;из легкого и высокопрочного алюминия с плетением из пластика темно-коричневого цвета.</p>', '<p><span>Garden4you mini MUSE 1188 &ndash; это привлекательный раскладной диван с навесом. Каркас изготовлен&nbsp;&nbsp;из легкого и высокопрочного алюминия с плетением из пластика темно-коричневого цвета. В производстве садовой мебели плетение из пластика очень популярно, так как он является прочным, влагоустойчивым и неприхотливым в уходе. Он идеально подходит для длительного использования на улице, а наличие навеса защитит вас от прямых солнечных лучей, при ненадобности он легко складывается. Диван Garden4you mini MUSE 1188 украсит террасу или сад дачного участка, загородного дома.</span></p>', 1, 7, 'Диван садовый Garden4you mini MUSE 1188', 'Диван садовый Garden4you mini MUSE 1188, Rugen, Садовые диваны', 'Каркас изготовлен из легкого и высокопрочного алюминия с плетением из пластика темно-коричневого цвета.', '2019-05-29 08:22:38', 1, 0, 0.00, 0, ''),
(4, 'shezlong-wicker-garden4you', 151, 'Шезлонг WICKER Garden4you', '<p>Каркас изделия &ndash; легкий и высокопрочный алюминий, стойкий к коррозии, влажности и скачкам температур.</p>', '<p><span>11758 &ndash; это практичный и удобный шезлонг из линейки WICKER, модели которой сделаны из крепкого и погодоустойчивого искусственного ротанга. Каркас изделия &ndash; легкий и высокопрочный алюминий, стойкий к коррозии, влажности и скачкам температур. Кроме надежности структуры этот материал отличается стильным и аккуратным внешним видом.&nbsp;&nbsp;Исполнение в цвете капучино смотрится очень интересно и привлекательно, и поможет шезлонгу отлично вписаться в любое окружение. Этот шезлонг оборудован механизмом регулировки положения спинки для нахождения наиболее удобного положения для вашего тела. Пара колесиков предназначена для облегчения перемещения лежака в подходящее место.</span></p>', 1, 8, 'Шезлонг WICKER Garden4you', 'Шезлонг WICKER Garden4you 11758, Шезлонги и лежаки', 'Каркас изделия &ndash; легкий и высокопрочный алюминий, стойкий к коррозии, влажности и скачкам температур.', '2019-05-29 07:10:04', 1, 0, 0.00, 0, ''),
(5, 'ulichnyj-gazovyj-obogrevatel-sundays-ph08-ss', 149, 'Уличный газовый обогреватель Sundays PH08-SS', '<p>Рабочая область этой модели: 6 кв.м. В пределах этого диаметра обогреватель нагревает пространство до комфортной летней температуры в +25 &deg;С.</p>', '<p><span>Sundays PH08-SS &ndash; это уличный обогреватель со стильным и оригинальным оформлением пирамидальной формы. PH08-SS изготовлен из устойчивого и долговечного металла. В верхней части корпуса расположена стеклянная длинная колба, внутри нее при работе обогревателя горит живой огонь. Пламя достигает высоты больше метра. Sundays PH08-SS не только хорошо греет, но и красиво освещает пространство вокруг себя. Отблески пламени создают романтичную атмосферу вокруг. Рабочая область этой модели: 6 кв.м. В пределах этого диаметра обогреватель нагревает пространство до комфортной летней температуры в +25 &deg;С. Газовый баллон и редуктор приобретаются отдельно.</span></p>', 1, 12, 'Уличный газовый обогреватель Sundays PH08-SS', 'Уличный газовый обогреватель Sundays PH08-SS, KETER, Уличные обогреватели', 'Рабочая область этой модели: 6 кв.м. В пределах этого диаметра обогреватель нагревает пространство до комфортной летней температуры в +25 &deg;С.', '2019-05-29 07:16:22', 1, 0, 0.00, 0, ''),
